import React from "react";
function Temp() {
  return (
    <div>
      <div className="box">
      <div className="heading">
      <h1>Weather App</h1>
      <img src="https://cdn.icon-icons.com/icons2/2211/PNG/512/weather_sun_sunny_cloud_icon_134157.png" />
      </div>
      
        <form className="inputField">
          <input type="search" name="inputBox" />
          <button type="submit"><i class="fa-solid fa-magnifying-glass"></i></button>
        </form>

      </div>
    </div>
  );
}
export default Temp;
